import React from 'react'
import { Route, Routes } from 'react-router-dom'
import Home from './components/Home'
import BookList from './components/BookList'

const App = () => {
    return (
        <>
            {/* <h1>App</h1> */}
            <Routes>
                <Route path='/' element={<Home />} />
                <Route path='/books' element={<BookList />} />
            </Routes>
        </>
    )
}

export default App
